import React, { useState, useEffect } from "react";
import "./Styles.css";

function Menu() {
  useEffect(() => {
    getData();
  }, []);

  const [items, setItems] = useState([]);

  const getData = async () => {
    const data =
      "https://api.spoonacular.com/recipes/random?number=10&tags=vegetarian,dessert&apiKey=66f3a4d769ef4fe49fa8a7233278bef6";
    fetch(data)
      .then((res) => data.json())
      .then((res) => {
        console.log(res);
        setItems(res.items);
      });
  };

  return (
    <div className="centered">
      <h3></h3>
    </div>
  );
}

export default Menu;
